import React, { useState, useEffect } from 'react';
import axios from 'axios';

const RandomImages = () => {
  const [randomImages, setRandomImages] = useState([]);

  useEffect(() => {
    // Fetch random images from Unsplash List Photos API
    axios
      .get('https://api.unsplash.com/search/photos', {
        params: {
          count: 10, // Number of random images to fetch
        },
        headers: {
            Authorization: `Client-ID mxIVjm1S9JohgUXlEdfJgNggR5wR7_z7Jdd5ecEMC5Q`,
        },
      })
      .then((response) => {
        setRandomImages(response.data);
      })
      .catch((error) => {
        console.error(error);
      });
  }, []);

  return (
    <div className="random-images">
      {randomImages.map((image) => (
        <div key={image.id} className="random-image">
          <img src={image.urls.small} alt={image.alt_description} />
          <div className="image-details">
            <p>User: {image.user.name}</p>
            <p>Likes: {image.likes}</p>
          </div>
        </div>
      ))}
    </div>
  );
};

export default RandomImages;
